function Navbar({ length }) {
	function count(){
		length > 0 ? <h2>Barcha kinolar soni: {length}</h2> : "Kino yo'q"
	}
  return (
	<div className='Navbar'>
		<nav>
			<h2>{count}</h2>
			<h3>Ko'rilganlar soni: </h3>
		</nav>
	</div>
  )
}

export default Navbar
